INSERT INTO `contest_assets` VALUES (49,64,0,'Big Banner','','2016-01-28 20:55:18','2016-01-28 23:55:18'),(50,64,1,'Small Banner','','2016-01-28 20:55:21','2016-01-28 23:55:21'),(51,64,2,'Home HTML','<p></p><h3><span style=\"color: #f2f2f2;\">Bienvenidos a la 1ª edición de Effie Latinoamérica 2016</span></h3><p><span style=\"color: #f2f2f2;\"><br/></span></p><p><span style=\"color: #f2f2f2;\">Estamos comenzando la primera edición del certamen en el ordenregional. Si bien Effie Latinoamérica es un programa nuevo en laregión, el premio Effie se ha ido posicionando gracias alreconocimiento de sus capítulos locales como el premio al que las agencias ylos anunciantes observan a la espera de la consagración de los trabajos másdestacados.</span></p><p><span style=\"color: #f2f2f2;\">Con el mayor de los agrados los invitamos a ser parte de la edición2016 de Effie Latinoamérica, una honorable celebración de ideasque funcionan.</span></p><p><span style=\"color: #f2f2f2;\">A medida que el nivel de las campañas de marketing va aumentandoaño a año, los premios ven llegar más inscripciones que demuestranimpresionantes ideas y ejecuciones al tiempo que alcanzan resultadosdestacados.</span></p><p><span style=\"color: #f2f2f2;\">Y mientras la competencia se va poniendo más exigente, no hay dudade que ganar un Effie se vuelve más deseable.</span></p><p><span style=\"color: #f2f2f2;\">Queremos destacar también la importanciadel Effie Effectiveness Index, un ranking global generadopor Effie Worldwide anualmente, que define y rankea a las agencias,redes, anunciantes y marcas más efectivos a través del análisis de losdatos de finalistas y ganadores de todas las ediciones de Effie anivel mundial.  </span></p><p><span style=\"color: #f2f2f2;\">Para contribuir a que el proceso de inscripción sea más efectivo,les brindaremos recursos útiles a travésdel sitio web de Effie LatAm. Los alentamos a quepuedan sacar la mayor ventaja de todo esto y que estén atentos a futuras actualizaciones. </span></p><p><span style=\"color: #f2f2f2;\">Esperamos contar con la participación de ustedes. </span></p><p><span style=\"color: #f2f2f2;\">Los mejores deseos,</span></p><p><span style=\"color: #f2f2f2;\">Jorge Raúl Martínez<br/>Chairman de Effie Latinoamérica</span></p>','2016-03-14 21:51:45','2016-03-15 00:51:45'),(52,64,3,'Home Bottom HTML',NULL,'2016-03-14 21:51:09','2016-03-15 00:51:09'),(53,64,5,'contest.termsHtml',NULL,'2016-02-16 18:51:02','2016-02-16 21:51:02'),(54,64,6,NULL,NULL,'2016-01-14 23:56:15','2016-01-14 23:56:15'),(55,65,0,NULL,NULL,'2016-03-24 04:49:24','2016-03-24 04:49:24'),(56,65,1,NULL,NULL,'2016-03-24 04:49:24','2016-03-24 04:49:24'),(57,65,2,NULL,NULL,'2016-03-24 04:49:24','2016-03-24 04:49:24'),(58,65,3,NULL,NULL,'2016-03-24 04:49:24','2016-03-24 04:49:24'),(59,65,5,NULL,NULL,'2016-03-24 04:49:24','2016-03-24 04:49:24'),(60,65,6,NULL,NULL,'2016-03-24 04:49:24','2016-03-24 04:49:24'),(61,65,7,'Inscripcion Ok','<h3> Hola :firstName :lastName</h3> <h4> Felicitaciones, te has inscripto exitosamente en :contest</h4> <h4> Atentamente, el equipo de :contest.</h4>','2016-03-24 04:49:24','2016-03-24 04:49:24'),(62,65,8,'Invitacion Inscriptor','<h4> Invitacion a test </h4> <h5> Usted ha sido invitado a participar como Inscriptor en test</h5> <h5> Atentamente, el equipo de test </h5>','2016-03-24 04:49:24','2016-03-24 04:49:24'),(63,65,9,'Invitacion Juez','<h4> Invitacion a test </h4> <h5> Usted ha sido invitado a participar como Juez en test</h5> <h5> Atentamente, el equipo de test </h5>','2016-03-24 04:49:24','2016-03-24 04:49:24'),(64,65,10,'Invitacion colaborador','<h4> Invitacion a test </h4> <h5> Usted ha sido invitado a participar como Colaborador en test</h5> <h5> Atentamente, el equipo de test </h5>','2016-03-24 04:49:24','2016-03-24 04:49:24'),(65,65,11,'Entry con error','<h3> Hola :firstName :lastName</h3> <h5> El entry :entry del contest test ha sido reportado como erroneo, con el siguiente mensaje <h4> :message </h4> haga click en el link pa