INSERT INTO `entry_metadata_fields` VALUES (77,64,'Datos generales',NULL,'{\"us\":{\"label\":\"General info\"}}',7,0,0,0,0,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(78,64,'Título del caso',NULL,'{\"us\":{\"label\":\"Case title\"}}',1,1,0,0,1,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(79,64,'Nombre de la marca',NULL,'{\"us\":{\"label\":\"Brand\"}}',1,1,0,0,2,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(80,64,'Tipo de producto o servicio','(ej: aerolínea, shampoo) No incluír el nombre de la marca','{\"us\":{\"label\":\"Service or product type\",\"description\":\"(eg airline, shampoo) Don\'t include the name of the brand\"}}',1,1,0,0,3,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(81,64,'Clasificación','Revise todas las que aplican.','{\"us\":{\"label\":\"Clasification\"}}',4,1,0,0,4,'{\"options\":[\"Local\",\"Regional\",\"Nacional\",\"Multinational\",\"No-Espa\\u00f1ol?\"],\"horizontal\":\"\"}','2016-03-04 23:19:58','2016-03-05 02:19:58'),(82,64,'Período de exhibición','',NULL,7,0,0,0,5,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(83,64,'Fecha de inicio','Proporcionar fechas para el lapso de tiempo de todo el esfuerzo,\n\nincluso si comenzó antes del período de elegibilidad de Effie',NULL,1,0,0,0,6,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(84,64,'Fecha de finalización',NULL,NULL,1,0,0,0,7,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(85,64,'En exhibición actualmente',NULL,NULL,4,1,0,0,8,'{\"options\":[\"Si\",\"No\"],\"horizontal\":\"\"}','2016-03-04 23:19:58','2016-03-05 02:19:58'),(86,64,'Resumen Ejecutivo','Proporcione un resumen ejecutivo de su caso de 100 palabras o menos, con el objetivo de dar a los jueces una  imagen clara del caso de estudio que están a punto de leer y de por qué deben considerarlo digno de un premio   efectividad.',NULL,7,0,0,0,9,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(88,64,'Resumen Ejecutivo',NULL,NULL,2,1,0,0,10,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(89,64,'SECCIÓN 1: ESTRATEGIA DE COMUNICACIÓN: DESAFÍOS Y OBJETIVOS','Esta sección provee a los jueces de un historial sobre los desafíos y objetivos. Los jueces asignarán 23,3% del puntaje total,\n\nbasándose en la información que sea proporcionada aquí. En esta sección, los jueces evalúan si tienen el contexto necesario \n\nsobre la categoría de su industria, competidores y marca para entender su caso como la complejidad del desafío representada \n\npor sus objetivos. Sea cuidadoso y comparta el contexto necesario para que los jueces no familiarizados con su industria \n\nentiendan el alcance de su esfuerzo.','{\"us\":{\"description\":\"xxxxxxxxxxxxxxxxxxxxxxxxxxxxx\"}}',7,0,0,0,11,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(90,64,'¿Cuál era el estado de los negocios de la marca y el mercado o de la categoría en la  que compite, antes de que comenzara su esfuerzo?','Proporcione categoría, competencia, y contexto del Mercado (ej: principales gastos de la competencia, posición en\n\nel mercado, categoría de referencia, etc). Comparta información sobre la compañía/marca.',NULL,2,0,0,0,12,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(91,64,'¿Cuál fue el desafío de la estrategia de comunicación? Disponga el contexto con respect  al grado de dificultad de este desafío y detalle la necesidad del negocio que este esfuerzo   estaba destinado a abordar','Manifieste los problemas de negocio que su esfuerzo estaba destinado a tratar y los retos/oportunidades \n\nespecíficos enfrentados por el cliente y/o la marca.',NULL,2,0,0,0,13,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(92,64,'Defina la audiencia que estaba intentando alcanzar.','Hable acerca de las actitudes y comportamientos de su audiencia. Descríbala usando herramientas demográficas,\n\npsicográficas, cultura, etc. Explique si su target es una audiencia existente, una nueva audiencia o ambas.',NULL,2,0,0,0,14,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(93,64,'¿Cuáles eran sus objetivos? ¿Cuáles eran los Indicadores Clave de Desempeño (KPIs)  sobre sus objetivos? Incluya números/porcentajes específicos y proporcione el contexto,   incluso antecedentes de la categoría, por el que los objetivos se tornaron importa','Su participación debe incluir uno o todos los objetivos que aquí se mencionan: A. Cuantificable, B. Comportamental, C. \n\nPerceptual /Actitudinal. Indique metas específicas para aquellos que aplican a su campaña., las herramientas de \n\nmedición que planeó usar. Proporcione un porcentaje o un número para cada una de sus metas. Debe brindar un punto \n\nde referencia y un contexto para sus metas vs. años anteriores, situando esto en el marco de un paisaje competitivo y \n\nuna categoría. Explique qué objetivos fueron los más importantes. Explique cómo los objetivos evolucionaron y por qué.',NULL,2,0,0,0,15,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(94,64,'SECCIÓN 2: INSIGHTS E IDEA ESTRATÉGICA','Esta sección requiere que explique a los jueces su proceso estratégico. Los jueces asignarán 23,3% del puntaje total, basándose\n\nen la información que sea proporcionada aquí. Resuma cómo los comportamientos y actitudes de su audiencia, y/o la situación \n\ndel negocio lo encaminaron hacia los insights específicos que llevarían al éxito de su marca y cómo esos insights participaron en \n\nsu idea estratégica.',NULL,7,0,0,0,16,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(96,64,'¿Cuál fue el insight que lo encaminó hacia la gran idea? ¿Cómo llegó a ese insight?','Describa lo que lo llevó a su idea- ej. Insights del negocio o del consumidor, un insight basado en datos, una\n\noportunidad de mercado/ marca, etc. Explique cómo la idea fue originada y cómo se aplica al desafío. A los fines \n\nde su participación, un insight no es solo una observación basada en un estudio; es el insight estratégico, único \n\npara su marca y audiencia, que fue aprovechado para cumplir sus objetivos.',NULL,2,0,0,0,17,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(97,64,'En una sola oración, formule su gran idea.','¿Cuál fue la idea central que condujo sus esfuerzos y lo llevó a unos resultados impactantes? ¿Cuál fue el \n\nverdadero corazón del éxito de este caso? La gran idea no es la ejecución ni el lema.',NULL,1,0,0,0,18,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(98,64,'SECCIÓN 3: LLEVANDO LA IDEA A LA VIDA','PREGUNTA 7 + APÉNDICE DE MEDIOS + EJEMPLOS CREATIVOS\n\nEsta sección se relaciona con cómo la idea fue llevada a la vida – incluyendo su creatividad, comunicaciones y estrategias \n\nde medios y el trabajo en sí mismo. Los jueces asignarán 23,3% del puntaje total, basándose en la información que sea \n\nproporcionada en las preguntas 7a y7b, en el Apéndice de Medios  y en su trabajo creativo como se presenta en reel y \n\nen las imágenes para la evaluación.  \n\nPreguntas 7a&b:  Resuma claramente sus estrategias y relaciónelas con su audiencia e insights.\n\nReel Creativo:  En el reel, los jueces esperan ver ejemplos de los puntos explicados íntegramente. Los jueces no evalúan \n\nla calidad de la producción del reel en sí; evalúan el trabajo creativo que salió al mercado, mientras se relacione con su \n\ndesafío, insights y estrategia.\n\nApéndice Creativo:  Los jueces revisan el Apéndice de Medios como soporte de las respuestas a la Pregunta 7 y de los \n\nejemplos de su trabajo creativo. Revise exhaustivamente el Apéndice de Medios para mayor precisión.',NULL,7,0,0,0,19,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(100,64,'¿Cómo trajo su idea a la vida? Explique su idea creative y su estrategia de  comunicación global, de acuerdo a los insights y desafío estratégico descriptos   previamente.','¿Su estrategia de comunicación fue cambiando a lo largo del tiempo?  De ser así, ¿cómo lo hizo?',NULL,2,0,0,0,20,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(101,64,'Explique detalladamente su estrategia de medios, incluyendo la razón de ser detrás de  sus key channel choices. ¿Por qué sus elecciones de canal y estrategia de medios   fueron correctas para su audiencia e idea específicas. Su explicación debe incluir qué','¿Cómo sus estrategias creativas y de medios funcionaron en conjunto para alcanzar su audiencia específica?\n\n¿Cómo influyo el insight en las elecciones de canales? Recordatorio: En el reel creativo, los jueces esperan ver \n\ncomo mínimo, un ejemplo completo de cada uno de los puntos integrales descriptos y sus respuestas deben \n\nrelacionarse directamente con los puntos de comunicación seleccionados en el Apéndice de Medios del área de \n\ninscripción online.',NULL,2,0,0,0,21,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(102,64,'SECCIÓN 4: RESULTADOS','Esta sección se relaciona con sus resultados.  . Los jueces asignarán 30% del puntaje total, basándose en la información que sea\n\nproporcionada aquí. Aségurese de proporcionar información de contexto y explicar la importancia de sus resultados y su relación \n\ncon el negocio de su marca. Se a alienta a los participantes a conectar los resultados a los objetivos detallados en la Sección 1. \n\nLos jueces también esperan pueda abordar cualquier otro factor que haya podido impactar en los resultados de esta sección.',NULL,7,0,0,0,22,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(104,64,'¿Cómo sabe si funcionó? Compare directamente los resultados con sus objetivos  específicos y los KPIs detallados en la Pregunta 5d. Expliqué por qué, con la respectiva   categoría y contexto, estos resultados son importantes para el negocio de la marca. De','Detalle por qué considera un éxito sus esfuerzos. Refierase a su audiencia específica (5c) y directamente a sus\n\nobjetivos y KPIs (5d). Demuestre cómo alcanzó o excedió esos objetivos utilizando métricas cuantitativas y de \n\ncomportamiento, como cualquier otra herramienta de medición o información. Proporcione un periodo de \n\ntiempo claro para toda la información detallada.\n\n Proporcione métricas previas y posteriors y una comprensión de las normas de la industria y de la categoría. \n\n¿Cómo sus esfuerzos condujeron su negocio? Debe mostrar cómo los KPIs alcanzados se conectaron \n\nindividualmente y cómo impactaron en conjunto el éxito general de sus esfuerzos.\n\n Para información confidencial, sera necesario agregar pruebas de desempeño o sumarlas como porcentajes, de \n\nser necesario. Los resultados numéricos que carezcan de un contexto que explique porqué fueron importantes \n\nserán ignorados.\n\n Nota: Los resultados evaluados por los jueces corresponden al period 01/09/2014-31/8/2015* en el territorio de \n\nLatinoamérica. Todos los resultados deben incluir  fechas/periodos claros de tiempo. Datos previos al 01/09/2014 \n\npueden ser incluidos (y se recomienda) para ser utilizado como contexto, sin embargo las inscripciones con \n\nresultados posteriores al periodo de eligibilidad (31/08/2015) serán descalificadas.*( Eligibilidad para la categoría \n\nde Estación 01/10/2014-30/09/2015)',NULL,2,0,0,0,23,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(105,64,'Más allá de sus esfuerzos ¿qué del mercado pudo haber afectado los resultados del  caso? Explique cualquier otro factor, ya sea que lo involucre o no, que pudo haber   contribuido a sus resultados.','Debe contestar esta pregunta o escribir “ningún otro factor”. No deje la pregunta en blanco. Recuerde, que las\n\ncomunicaciones de marketing rara vez funcionan aisladas y esta es su oportunidad para explicar qué es lo que \n\nestaba sucediendo para convencer al jurado del impacto de su caso haciendo alusión a factores como el clima, los \n\nprecios, la distribución, factores económicos, etc. El participante es alentado a utilizar este espacio para descartar \n\nfactores que los jueces puedan llegar a creer influyentes en sus resultados.',NULL,2,0,0,0,24,NULL,'2016-03-04 23:19:58','2016-03-05 02:19:58'),(106,64,'Piezas','Video .mov h264, Audio mp3 128kbps, Imagen jpg o png 2500pixels en su base mayor','{\"us\":{\"label\":\"Files\"}}',10,0,0,0,25,'{\"min\":0,\"max\":0,\"types\":[]}','2016-03-04 23:19:58','2016-03-05 02:19:58'),(108,64,'TV',NULL,NULL,11,0,0,0,26,'{\"columns\":[\"Pais 1\",\"Pais 2\",\"Pais 3\"],\"labels\":[\"Spots\",\"Branded Content\"]}','2016-03-05 02:19:58','2016-03-05 02:19:58'),(109,65,'texto',NULL,NULL,1,0,0,0,0,NULL,'2016-03-24 19:59:57','2016-03-24 22:59:57'),(110,65,'mul col',NULL,NULL,11,0,0,0,1,'{\"columns\":[\"columna 1\",\"columna 2\",\"columna 3\"],\"labels\":[\"opcion 1\",\"opcion 2\"]}','2016-03-24 19:59:57','2016-03-24 22:59:57'),(111,65,'multiple',NULL,NULL,5,0,0,0,2,'{\"options\":[\"primera opcion\",\"segunda opcion\",\"tercera opcion\",\"cuarta opcion\"],\"horizontal\":1}','2016-03-24 19:59:57','2016-03-24 22:59:57'),(112,66,'Detalles de Inscripción',NULL,NULL,7,0,0,0,0,NULL,'2016-03-28 19:17:57','2016-03-28 22:17:57'),(113,66,'Nombre de la marca',NULL,NULL,1,1,0,0,1,NULL,'2016-03-28 19:17:57','2016-03-28 22:17:57'),(114,66,'Tipo de Producto o Servicio',NULL,NULL,1,1,0,0,2,NULL,'2016-03-28 19:17:57','2016-03-28 22:17:57'),(115,66,'Título del caso',NULL,NULL,1,1,0,0,3,NULL,'2016-03-28 19:17:57','2016-03-28 22:17:57'),(116,66,'Países y Período de Tiempo del Caso','Mencionar un mínimo de 2 y un máximo de 3 países para este caso. Proporcionar fechas en DD/MM/AA de lapso de tiempo para el caso incluso si comenzó antes o después de que termine el Período de Evaluación.',NULL,7,0,0,0,5,NULL,'2016-03-28 19:17:57','2016-03-28 22:17:57'),(117,66,'País',NULL,NULL,1,1,0,0,7,NULL,'2016-03-28 19:17:57','2016-03-28 22:17:57'),(118,66,'Fecha de inicio',NULL,NULL,1,1,0,0,8,NULL,'2016-03-28 19:17:57','2016-03-28 22:17:57'),(119,66,'Fecha de Finalización',NULL,NULL,1,1,0,0,9,NULL,'2016-03-28 19:17:57','2016-03-28 22:17:57'),(120,66,'País 2',NULL,NULL,1,1,0,0,10,NULL,'2016-03-28 19:17:57','2016-03-28 22:17:57'),(121,66,'Fecha de inicio',NULL,NULL,1,1,0,0,11,NULL,'2016-03-28 19:17:57','2016-03-28 22:17:57'),(122,66,'Fecha de Finalización',NULL,NULL,1,1,0,0,12,NULL,'2016-03-28 19:17:57','2016-03-28 22:17:57'),(123,66,'País 3',NULL,NULL,1,0,0,0,13,NULL,'2016-03-28 19:17:58','2016-03-28 22:17:58'),(124,66,'Fecha de inicio',NULL,NULL,1,0,0,0,14,NULL,'2016-03-28 19:17:58','2016-03-28 22:17:58'),(125,66,'Fecha de Finalización',NULL,NULL,1,0,0,0,15,NULL,'2016-03-28 19:17:58','2016-03-28 22:17:58'),(126,66,'Número total de países en los que el caso fue o es exhibido',NULL,NULL,1,1,0,0,16,NULL,'2016-03-28 19:17:58','2016-03-28 22:17:58'),(127,66,'Participación en Categorías Especiales','¿Por qué cree que su caso de adecúa particularmente a esta categoría especial? En 100 palabras o menos, esboce cómo responde a los criterios de las Categorías Especiales de Effie. Si su caso está ingresando en  cualquiera de las otras 15  categorías de Productos y Servicios, escriba “NO APLICA”.\nProporcione una explicación de 100 palabras o menos',NULL,2,0,0,0,18,NULL,'2016-03-28 19:17:58','2016-03-28 22:17:58'),(128,66,'Resumen Ejecutivo','Proporcione un resumen ejecutivo de su caso en 100 palabras o menos, con el objetivo de brindar a los jurados una imagen clara del caso de estudio que están a punto de leer y de porqué deben considerarlo digno de un premio a la efectividad.',NULL,2,0,0,0,19,NULL,'2016-03-28 19:17:59','2016-03-28 22:17:59'),(129,66,'Explique el criterio utilizado para determinar los países que son mencionados en este caso','Los participantes son alentados a inscribir países que demuestren un alto grado de desafíos y diversidad. Explique los criterios que ha utilizado para definir el mercado o los mercados top que están siendo presentados en este caso. (Ej.: ¿Inversión en medios en cada país? ¿Mercado de mayor volumen en la región? ¿El mayor desafío/reto en cada mercado?). Sea específico acerca de por qué estos países han sido seleccionados para demostrar el éxito regional de su caso.',NULL,2,0,0,0,20,NULL,'2016-03-28 19:17:59','2016-03-28 22:17:59'),(130,66,'Antecedentes de Mercado',NULL,NULL,7,0,0,0,21,NULL,'2016-03-28 19:17:59','2016-03-28 22:17:59'),(131,66,'Describa los antecedentes de mercado específicos que correspondan a los países que se presentan en el caso','Explique cualquier característica relevante o tendencia única para estos mercados/países que los distinga de otros países de la región. (Por ejemplo, si hay regulaciones gubernamentales en el lugar, si el mercado es  excepcionalmente grande o pequeño, etc). Destaque cualquier punto específico y relevante que los jurados deban conocer para evaluar mejor el caso en el contexto de los países elegidos.',NULL,2,0,0,0,22,NULL,'2016-03-28 19:17:59','2016-03-28 22:17:59'),(132,66,'SECCIÓN 1: ESTRATEGIA DE COMUNICACIÓN: DESAFÍOS Y OBJETIVOS – 23.3% DEL PUNTAJE','Esta sección provee a los jueces de un historial sobre los desafíos y objetivos. Los jueces asignarán 23,3% del puntaje total, basándose en la información que sea proporcionada aquí. \nEn esta sección, los jueces evalúan si tienen el contexto necesario sobre la categoría de su industria, competidores y marca para entender su caso como la complejidad del desafío representada por sus objetivos. Sea cuidadoso y comparta el contexto necesario para que los jueces no familiarizados con su industria entiendan el alcance de su esfuerzo.',NULL,7,0,0,0,24,NULL,'2016-03-28 19:17:59','2016-03-28 22:17:59'),(133,66,'Desafío estratégico + Objetivos',NULL,NULL,7,0,0,0,25,NULL,'2016-03-28 19:17:59','2016-03-28 22:17:59'),(134,66,'¿Cuál era el estado del negocio, de la marca y del mercado o de la categoría en la que compite, antes de que comenzara su esfuerzo publicitario?','Proporcione información acerca de la categoría, competencia y contexto del mercado (ej.: principales gastos de la competencia, posición en el mercado, categoría de referencia, etc) Comparta información sobre la compañía/marca.',NULL,2,0,0,0,26,NULL,'2016-03-28 19:17:59','2016-03-28 22:17:59'),(135,66,'¿Cuál fue el desafío de la estrategia de comunicación? Proporcione el contexto con respecto al grado de dificultad de este desafío y detalle la necesidad del negocio que este esfuerzo publicitario estaba destinado a abordar.','Manifieste los problemas del negocio que su esfuerzo publicitario estaba destinado a tratar y los retos/oportunidades específicos que debió enfrentar el cliente y/o la marca.',NULL,2,0,0,0,28,NULL,'2016-03-28 19:17:59','2016-03-28 22:17:59'),(136,66,'Defina la audiencia que buscaba alcanzar.','Describa las actitudes, los comportamientos y la cultura de su audiencia. ¿Por qué es su target? Descríbala usando herramientas demográficas, psicográficas, cultura, etc. Explique si su target es una audiencia existente, una nueva audiencia o ambas.',NULL,2,0,0,0,29,NULL,'2016-03-28 19:17:59','2016-03-28 22:17:59'),(137,66,'¿Cuáles fueron sus objetivos? ¿Cuáles fueron los Indicadores Clave de Desempeño (KPIs) sobre sus objetivos? Indicar metas específicas con un detalle de país por país.','Su participación debe incluir uno o todos los objetivos que aquí se mencionan: A. Cuantificable, B. Comportamental, C. Perceptual /Actitudinal. Indique metas específicas para aquellos objetivos que aplican a su campaña y las herramientas de medición que planeó usar. Proporcione un porcentaje (%) o un número (#) para cada una de sus metas. Debe brindar un punto de referencia y un contexto para sus metas vs. los años anteriores, situando esto en el marco de un ambiente competitivo y una categoría. Explique por qué los objetivos son importantes para la marca y el crecimiento del negocio, y cuáles de esos objetivos fueron los más importantes. Explique cómo los objetivos evolucionaron y por qué.',NULL,2,0,0,0,30,NULL,'2016-03-28 19:17:59','2016-03-28 22:17:59'),(138,66,'SECCIÓN 2: INSIGHTS E IDEA ESTRATÉGICA– 23.3% DEL PUNTAJE','Esta sección requiere que explique a los jueces su proceso estratégico. Los jueces asignarán 23,3% del puntaje total, basándose en la información que sea proporcionada aquí. Resuma cómo los comportamientos y actitudes de su audiencia, y/o la situación del negocio lo encaminaron hacia los insights específicos que llevarían al éxito de su marca y cómo esos insights participaron en su idea estratégica.',NULL,7,0,0,0,33,NULL,'2016-03-28 19:18:00','2016-03-28 22:18:00'),(139,66,'Idea',NULL,NULL,7,0,0,0,34,NULL,'2016-03-28 19:18:00','2016-03-28 22:18:00'),(140,66,'¿Cuál fue el insight que lo condujo hacia la gran idea? ¿Cómo llegó a ese insight?','Describa lo que lo llevó a su idea (ej.: insights del negocio o del consumidor, un insight basado en datos, una oportunidad de mercado/ marca, etc. Explique cómo la idea fue originada y cómo se aplica al desafío. A los fines de su participación, un insight no es solo una observación basada en un estudio; es el insight estratégico, único para su marca y audiencia, que fue aprovechado para cumplir sus objetivos.',NULL,2,0,0,0,35,NULL,'2016-03-28 19:18:00','2016-03-28 22:18:00'),(141,66,'En una sola oración, formule su gran idea.','¿Cuál fue la idea central que condujo sus esfuerzos y lo llevó a unos resultados impactantes? ¿Cuál fue el verdadero corazón del éxito de este caso? La gran idea no es la ejecución ni el lema.',NULL,2,0,0,0,36,NULL,'2016-03-28 19:18:00','2016-03-28 22:18:00'),(142,66,'¿Cómo evolucionó su gran idea?','Explique cómo su gran idea evolucionó a través de los países en cuestión, manteniendo la continuidad/integridad?',NULL,2,0,0,0,37,NULL,'2016-03-28 19:18:00','2016-03-28 22:18:00'),(143,66,'SECCIÓN 3: LLEVANDO LA IDEA A LA VIDA – 23.3% DEL PUNTAJE','Esta sección se relaciona con cómo la idea fue llevada a la vida incluyendo su creatividad, comunicaciones y estrategias de medios y el trabajo en sí mismo. Los jueces asignarán 23,3% del puntaje total, basándose en la información que sea proporcionada en las preguntas 11a y 11b y en su trabajo creativo como se presenta en el reel y en las imágenes para la evaluación.  \nPreguntas 11a&b: Resuma claramente sus estrategias y relaciónelas con su audiencia e insights.\nReel Creativo: En el reel, los jueces esperan ver ejemplos de los puntos explicados íntegramente. Los jueces no evalúan la calidad de la producción del reel en sí; evalúan el trabajo creativo que salió al mercado, mientras se relacione con su desafío, insights y estrategia.',NULL,7,0,0,0,38,NULL,'2016-03-28 19:18:00','2016-03-28 22:18:00'),(144,66,'Llevando la idea a la vida',NULL,NULL,7,0,0,0,39,NULL,'2016-03-28 19:18:00','2016-03-28 22:18:00'),(145,66,'¿Cómo llevó su idea a la vida?  Explique la estrategia de comunicación, incluyendo su estrategia de medios, y la razón fundamental detrás de las elecciones de canal.','Describa y comparta la razón detrás de la estrategia de comunicación que llevó su idea a la vida, relacionada con los insights y el desafío estratégico descriptos anteriormente. ¿Cómo sus estrategias creativas y de medios trabajaron en conjunto para alcanzar su audiencia específica? ¿Cómo relacionó el insight a las elecciones de canal, y qué papel tuvo eso dentro de la estrategia para llevar la idea a la vida en general? Explique su estrategia de medios y por qué las elecciones de canal realizadas fueron las correctas para su audiencia y su idea. ¿Su estrategia de comunicación fue cambiando a lo largo del tiempo? De ser así, ¿cómo lo hizo?\nDetalle las formas en que los desafíos locales impactaron en la manera en que la idea se llevó a cabo en cada país, y cómo fue culturalmente relevante a cada entorno. Describa por qué fueron elegidas ciertas estrategias para diferentes mercados.',NULL,2,0,0,0,40,NULL,'2016-03-28 19:18:00','2016-03-28 22:18:00'),(146,66,'Puntos de contacto de comunicación. Controle todos los puntos utilizados para este caso.','Puntos de contacto de comunicación. Controle todos los puntos utilizados para este caso.',NULL,11,0,0,0,41,'{\"columns\":[\"Pa\\u00eds 1\",\"Pa\\u00eds 2\",\"Pa\\u00eds 3\"],\"labels\":[\"TV - Spots\",\"TV - Branded Content\",\"TV - Sponsorship\",\"TV - Product Placement\",\"TV - Interactive \\/ VOD\",\"Radio - Spots\",\"Radio - Merchandizing\",\"Radio - Program Content\",\"Print - Trade\\/Professional\",\"Print - 