ial (ingrese N/A si No Aplica)',NULL,1,0,0,0,54,NULL,'2016-03-28 19:18:02','2016-03-28 22:18:02'),(158,66,'Pais 2','Presupuesto anual promedio para este caso en el año inicial (ingrese N/A si No Aplica)',NULL,1,0,0,0,55,NULL,'2016-03-28 19:18:03','2016-03-28 22:18:03'),(159,66,'Pais 3','Presupuesto anual promedio para este caso en el año inicial (ingrese N/A si No Aplica)',NULL,1,0,0,0,56,NULL,'2016-03-28 19:18:03','2016-03-28 22:18:03'),(160,66,'Pais 1','Indicar el % aproximado del presupuesto total de medios invertido para este caso en cada mercado.  Ej: Si su presupuesto total de medios fue X para el caso sobre 10 mercados esto sería = 100%.  Qué % de ese 100% fue invertido en cada mercado seleccionado?',NULL,1,0,0,0,57,NULL,'2016-03-28 19:18:04','2016-03-28 22:18:04'),(161,66,'Pais 2','Indicar el % aproximado del presupuesto total de medios invertido para este caso en cada mercado.  Ej: Si su presupuesto total de medios fue X para el caso sobre 10 mercados esto sería = 100%.  Qué % de ese 100% fue invertido en cada mercado seleccionado?',NULL,1,0,0,0,58,NULL,'2016-03-28 19:18:04','2016-03-28 22:18:04'),(162,66,'Pais 3','Indicar el % aproximado del presupuesto total de medios invertido para este caso en cada mercado.  Ej: Si su presupuesto total de medios fue X para el caso sobre 10 mercados esto sería = 100%.  Qué % de ese 100% fue invertido en cada mercado seleccionado?',NULL,1,0,0,0,59,NULL,'2016-03-28 19:18:04','2016-03-28 22:18:04'),(163,66,'Presupuesto 1','Según su estimación, comparado con otros competidores en esta categoría, el presupuesto es:',NULL,11,0,0,0,60,'{\"columns\":[\"Pa\\u00eds 1\",\"Pa\\u00eds 2\",\"Pa\\u00eds 3\"],\"labels\":[\"Menos\",\"Casi el mismo\",\"Superior\"]}','2016-03-28 19:18:04','2016-03-28 22:18:04'),(164,66,'Presupuesto 2','Comparado al gasto total de la marca en el primer año, el presupuesto invertido este año es:',NULL,11,0,0,0,61,'{\"columns\":[\"Pa\\u00eds 1\",\"Pa\\u00eds 2\",\"Pa\\u00eds 3\"],\"labels\":[\"Menos\",\"Casi 