xponer resultados. Proporcione datos y prueba de resultados país por país y no con datos consolidados.',NULL,2,0,0,0,67,NULL,'2016-03-28 19:18:05','2016-03-28 22:18:04'),(171,66,'¿Cómo sabe si funcionó?  (Incluya KPIs) ¿Por qué estos resultados son importantes para la marca?','Expliqué por qué, con el respectivo contexto, estos resultados son importantes para su categoría y el negocio de la marca. ¿Cómo sus esfuerzos condujeron su negocio? Para información confidencial, será necesario agregar pruebas de desempeño o sumarlas como porcentajes, de ser necesario. Los resultados numéricos que carezcan de un contexto que explique por qué fueron importantes, serán ignorados. Proporcione métricas previas y posteriores y una comprensión de las normas de la industria y de la categoría. Debe mostrar cómo los KPIs alcanzados se conectaron individualmente y cómo impactaron en conjunto el éxito general de sus esfuerzos.\n\nNota:Solo los resultados que se encuentren dentro del periodo 01/09/2014 al 31/03/2016 serán evaluados por los jueces. Las fechas de todos los resultados presentados deberán ser incluidas para evitar confusión. No incluya resultados después del 31/03/2016. Esto podrá resultar en descalificación.',NULL,2,0,0,0,68,NULL,'2016-03-28 19:18:05','2016-03-28 22:18:05'),(172,66,'Más allá de sus esfuerzos ¿hay algún aspecto del mercado que pudo haber afectado los resultados del caso? Explique cualquier otro factor, ya sea que lo involucre o no, y que pueda haber contribuido a sus resultados.','Debe contestar esta pregunta o escribir “ningún otro factor”. Recuerde, que las comunicaciones de marketing rara vez funcionan aisladas y esta es su oportunidad para explicar qué es lo que estaba sucediendo para convencer al jurado del impacto de su caso haciendo alusión a factores como el clima, los precios, la distribución, factores económicos, etc. El participante es alentado a utilizar este espacio para descartar factores que los jueces puedan llegar a creer influyentes en sus resultados.',NULL,2,0,0,0,69,NULL,'2016-03-28 19:18:05','2016-03-28 22:18:05'),(173,66,'Nombre los países en los que el caso fue exhibido/ejecutado.','Mencionar todos los países en los que el caso se desarrolló teniendo en cuenta el periodo de calificación.',NULL,2,0,0,0,70,NULL,'2016-03-28 19:18:05','2016-03-28 22:18:05'),(174,66,'País y período de tiempo para el caso','Proporcionar fechas en DD/MM/AA para el lapso de tiempo de su caso incluso si comenzó antes o si terminará luego del período de elegibilidad que califica.',NULL,7,0,0,0,6,NULL,'2016-03-28 19:17:57','2016-03-28 22:17:57'),(175,66,'Puntos de contacto de comunicación. Controle todos los puntos utilizados para este caso.','Indique a continuación, todos los puntos de contacto de comunicación utilizados para este caso. En el caso escrito deberán presentarse los respectivos detalles y, dentro de los materiales creativos deberán mostrarse al menos un ejemplo de cada punto de comunicación marcado a continuación que haya sido esencial para el éxito de su esfuerzo publicitario. Por ejemplo, si marca 30 casilleros y 10 fueron la clave para alcanzar los resultados y explicados como esenciales en el formulario escrito, esos 10 deben ser incluidos dentro de sus materiales creativos.',NULL,5,0,0,0,42,'{\"options\":[\"TV - Spots\",\"TV - Branded Content\",\"TV - Sponsorship\",\"TV - Product Placement\",\"TV - Interactive TV\\/Video on Demand\",\"Radio - Spots\",\"Radio - Merchandizing\",\"Radio - Programme\\/Content\",\"Material impreso - Trade\\/Professional\",\"Material impreso - Newspaper Print\",\"Material impreso - Newspaper Digital\",\"Material impreso - Magazine Print\",\"Material impreso - Magazine Digital\",\"Material impreso - Custom Publication\",\"Directo Correo\",\"Directo Email\",\"PR\",\"Guerrilla - Street Teams\",\"Guerrilla - Tagging\",\"Guerrilla - Wraps\",\"Guerrilla - Buzz Marketing\",\"Guerrilla - Ambient Media\",\"Guerrilla - Sampling\\/Trial\",\"Events\",\"Cinema\",\"Ecommerce\",\"Interactivo\