el Marketing','Seleccione los componentes que estuvieron activos y explique el efecto de aquellos seleccionados a continuación.',NULL,5,0,0,0,45,'{\"options\":[\"Ninguno\",\"Cupones\",\"CRM \\/ Programas de Fidelidad\",\"Regalos\\/Muestras gratis\",\"Distribuci\\u00f3n escalonada\",\"Cualquier otra herramienta de marketing para la marca, en el periodo de tiempo de este esfuerzo\",\"Rebajas\\/Cambios de precio\",\"Otros\"],\"horizontal\":0}','2016-03-28 19:18:01','2016-03-28 22:18:01'),(177,66,'Gastos/ Inversión en Medios','Seleccione los gastos (comprados y donados), sin incluir las tarifas de agencias o gastos de producción, por los esfuerzos descriptos en este caso. Dado el “espíritu” de esta pregunta use su juicio en lo que constituye tarifas, producción y el amplio abanico que implican los medios- desde espacio donado hasta costos de activación. Controle uno a uno cada cuadro. Detalle el contexto alrededor del presupuesto.\n *Todos los valores deben ser expresados en dólares estadounidenses (USD).',NULL,7,0,0,0,49,NULL,'2016-03-28 19:18:02','2016-03-28 22:18:02'),(178,66,'Inversión en Medios Pagos',NULL,NULL,11,0,0,0,50,'{\"columns\":[\"A\\u00f1o actual\",\"A\\u00f1o anterior\"],\"labels\":[\"No Aplica\",\"menos de $100K\",\"$100K - $250K\",\"$250K - $500K\",\"$500K - $1M\",\"$1M - $5M\",\"$5M - $10M\",\"$10M - $20M\",\"$20M o m\\u00e1s\"]}','2016-03-28 19:18:02','2016-03-28 22:18:02'),(179,66,'En comparación con otros competidores en esta categoría, el presupuesto es',NULL,NULL,4,0,0,0,52,'{\"options\":[\"Menor\",\"Similar\",\"Mayor\",\"No aplica\"],\"horizontal\":\"\"}','2016-03-28 19:18:02','2016-03-28 22:18:02'),(180,66,'En comparación con el gasto general de la marca el año anterior, el presupuesto este año es',NULL,NULL,4,0,0,0,53,'{\"options\":[\"Menor\",\"Similar\",\"Mayor\",\"No aplica\"],\"horizontal\":\"\"}','2016-03-28 19:18:02','2016-03-28 22:18:02'),(181,66,'Defina al segmento de compradores','Resalte el momento de compra, las motivaciones, comportamientos, y la mentalidad del comprador.',NULL,2,0,0,0,32,NULL,'2016-03-28 19:18:00','2016-03-28 22:18:00'),(182,66,'Describa los antecedentes de mercado relacionados al país al que refiere la inscripción del caso, y cómo fue cambiando con el tiempo','Explique cualquier característica relevante o tendencia única para este mercado/país que lo distinga de otros países de la región. (Por ejemplo, si hay regulaciones gubernamentales en el lugar, si el mercado es excepcionalmente grande o pequeño, etc.), también si ha cambiado o no con el tiempo, y de ser así cómo lo hizo. Destaque cualquier punto específico y relevante que los jurados deban conocer para evaluar mejor el caso en el contexto del país.',NULL,2,0,0,0,23,NULL,'2016-03-28 19:17:59','2016-03-28 22:17:59'),(184,66,'¿Cuál era el estado del negocio, de la marca y del mercado o de la categoría en la que compite, antes de que comenzara su esfuerzo publicitario, y cómo  cambió en el tiempo?','Defina éxito en su categoría. ¿Qué estaba sucediendo en el Mercado y en la categoría al principio del caso, y a lo largo del tiempo?\nProporcione información acerca de la categoría, competencia y contexto del mercado (ej.: principales gastos de la competencia, posición en el mercado, categoría de referencia, etc.)  y/o datos sobre el producto/servicio que creó su desafío. Comparta información sobre la compañía/marca.',NULL,2,0,0,0,27,NULL,'2016-03-28 19:17:59','2016-03-28 22:17:59'),(185,66,'¿Cuáles fueron sus objetivos al principio y cómo cambiaron con el tiempo? ¿Cuáles fueron los Indicadores Clave de Desempeño (KPIs) sobre sus objetivos? Indicar metas específicas','Su participación debe incluir uno o todos los objetivos que aquí se mencionan: A. Cuantificable, B. Comportamental, C. Perceptual /Actitudinal. Indique metas específicas para aquellos objetivos que aplican a su campaña y las herramientas de medición que planeó usar para medir cada objetivo. Proporcione referencias de un año previo para cada KPI o el contexto de por qué son importantes, si no están disponibles las referencias previas. Proporcione un porcentaje (%) o un número (#) y un periodo de tiempo para cada una de sus metas. Explique: ¿Cuál fue la respuesta de comportamiento o perceptual/ actitudinal que buscaba en el contexto de su competencia y categoría? Indique los objetivos iniciales y proporcione el contexto relacionado a cómo / por qué cambiaron con el tiempo.',NULL,2,0,0,0,31,NULL,'2016-03-28 19:18:00','2016-03-28 22:18:00'),(187,66,'Otros','Describa en menos de 100 caracteres',NULL,2,0,0,0,44,NULL,'2016-03-28 19:18:01','2016-03-28 22:18:01'),(188,66,'Puntos de contacto de comunicación. Controle todos los puntos utilizados para este caso.','Indique a continuación, todos los puntos de contacto de comunicación utilizados para este caso. En el caso escrito deberán presentarse los respectivos detalles y, dentro de los materiales creativos deberán mostrarse al menos un ejemplo de cada punto de comunicación marcado a continuación, que haya sido esencial para el éxito de su esfuerzo publicitario. Por ejemplo, si marca 30 casilleros y 10 fueron la clave para alcanzar los resultados y explicados como esenciales en el formulario escrito, esos 10 deben ser incluidos dentro de sus materiales creativos.',NULL,11,0,0,0,43,'{\"columns\":[\"Pre\",\"During\",\"Post\"],\"labels\":[\"Retail Experience - POP\",\"Retail Experience - In-Store Video\\/Kiosk\",\"Retail Experience - In-Store Merchandising\",\"Retail Experience - Sales Promotion\",\"Retail Experience - Retailtainment\",\"Retail Experience - Store within a Store\",\"Digital\\/Interactive - MFR\\/Retailer Website\",\"Digital\\/Interactive - Developed Retailer\\/Site Content\",\"Digital\\/Interactive - Display Ads\",\"Digital\\/Interactive - Social Networking\",\"Digital\\/Interactive - Gaming\",\"Digital\\/Interactive - Other\",\"Packaging\",\"Product Design - Account Specific\",\"Product Design - Promo Specific\",\"Pricing - Trade\",\"Pricing - Couponing\",\"Mobile\\/Tablet App\",\"Mobile\\/Tablet In-App or In-Game Ad\",\"Mobile\\/Tablet Messaging\\/Editorial\\/Content\",\"Mobile\\/Tablet Display Ad\",\"Mobile\\/Tablet Location-based Communications\\/               Real Time Marketing\",\"Mobile\\/Tablet Other\",\"Direct - Mail\",\"Direct - Email\",\"Direct - Retail Specific\",\"Sampling - InStore\",\"Sampling - OOH (event)\",\"Sampling - Direct Mail\",\"Shopper Involvement - WOM\",\"Shopper Involvement - Consumer Generated\",\"Shopper Involvement - Viral\",\"Sponsorship\",\"Events\",\"Radio - Spots\",\"Radio - Promo\\/Endorsements\",\"Radio - Program\\/Content\",\"Distribution Changes\",\"Guerrilla - Street Teams\",\"Guerrilla - Tagging\",\"Guerrilla - Wraps\",\"Guerrilla - Buzz Marketing\",\"Guerrilla - Ambient Media\",\"E-commerce\",\"Print - Retailer Specific Publication\",\"Print - Newspaper Print\",\"Print - Newspaper Digital\",\"Print - Magazine Print\",\"Print - Magazine Digital\",\"Print - Custom Publication\",\"OOH - Airport\",\"OOH - Transit\",\"OOH - Billboard\",\"OOH - Place Based\",\"OOH - Other\",\"TV - co-op\",\"TV - Spots\",\"TV - National Tagged Sports\",\"TV - Branded Content\",\"TV - Sponsorship\",\"TV - Product Placement\",\"PR\",\"Trade Communications\\/ Promo\",\"Trade Shows\",\"Branded Content\",\"Search Engine Marketing (SEM\\/SEO)\",\"Social Media\",\"Other\"]}','2016-03-28 19:18:01','2016-03-28 22:18:01'),(189,66,'Créditos & Effie Effectiveness Index','CREDITS & EFFIE INDEX\nEs necesario que se presenten los créditos de todos los principales socios estratégicos de su esfuerzo, tanto de empresa como individuales. Los créditos cargados durante el periodo de inscripción serán tenidos en cuenta para el Effie Index, y para completar todo el resto de materiales Effie que sean necesarios. \n\nNOTA: Es una política de Effie honrar a aquellos que figuran en los créditos, en caso de resultar finalistas o ganadores. Por lo tanto, no se podrán quitar ni remplazar créditos después de que el caso haya sido presentado. Es responsabilidad de los participantes asegurarse de que los créditos sean cargados correctamente. Antes de presentar la inscripción, revise estos créditos con quien corresponda.\n\nCRÉDITOS DE EMPRESA\nTodos los créditos de las agencias/empresas anunciantes serán tenidos en cuenta para los resultados del Effie Effectiveness Index®.  Es esencial que todas las empresas sean nombradas correctamente, ya sea que hayan liderado el caso, acompañado el liderazgo o contribuido con su desarrollo. Recomendamos que los participantes se comuniquen con las otras oficinas de su agencia, oficina corporativa, y departamento de PR para asegurarse de que todos los nombres de agencias sean escritos correctamente.  Esta información también debe ser compartida con compañías que hayan contribuido.\nSi nombra menos empresas que las 8 permitidas, no es necesario que indique nada en los espacios que no utiliza. Sin embargo, por cada empresa que nombre, debe completar todos los campos correspondientes.\n\nELIMINACIÓN DE CRÉDITOS\nUna vez que el caso es presentado, los créditos de empresa/individuales no pueden ser eliminados/removidos. Sin excepciones.\n\nCAMBIO DE CRÉDITOS\nTanto los créditos de empresa como los individuales deben ser controlados minuciosamente al momento de la inscripción. Los créditos no pueden ser removidos ni reemplazados. El añadido de créditos o los cambios de formato serán aprobados  dependiendo de cada caso en particular. No se aceptarán pedidos de modificaciones/correcciones de créditos después del 3 de junio de 2016. El cliente, la agencia principal y la agencia contribuyente (si aplica) son considerados definitivos en el momento de inscripción y no podrán ser removidos o agregados después de que se haya finalizado la inscripción y Effie Latin America la haya aceptado\n\nEFFECTIVENESS INDEX\nEl Effie Effectiveness Index identifica y rankea a las agencias, redes, holdings, anunciantes y marcas más efectivos de la industria del marketing y las comunicaciones, teniendo en cuenta la información de finalistas y  ganadores proveniente de los 40 certámenes de Effie Awards alrededor del mundo. Tanto finalistas como ganadores reciben puntos para ser incluidos en el Index. Para más información sobre el sistema de puntos del Index: www.effieindex.com',NULL,7,0,0,0,71,NULL,'2016-03-28 19:18:05','2016-03-28 22:18:05'),(190,66,'Agencia principal 1 - Créditos',NULL,NULL,7,0,0,0,72,NULL,'2016-03-28 19:18:05','2016-03-28 22:18:05'),(191,66,'Nombre de la compañía',NULL,NULL,1,0,0,0,73,NULL,'2016-03-28 19:18:05','2016-03-28 22:18:05'),(192,66,'Dirección',NULL,NULL,1,0,0,0,74,NULL,'2016-03-28 19:18:05','2016-03-28 22:18:05'),(193,66,'Ciudad',NULL,NULL,1,0,0,0,75,NULL,'2016-03-28 19:18:05','2016-03-28 22:18:05'),(194,66,'Estado/Provincia',NULL,NULL,1,0,0,0,76,NULL,'2016-03-28 19:18:05','2016-03-28 22:18:05'),(195,66,'Código Postal',NULL,NULL,1,0,0,0,77,NULL,'2016-03-28 19:18:05','2016-03-28 22:18:05'),(196,66,'País',NULL,NULL,1,0,0,0,78,NULL,'2016-03-28 19:18:05','2016-03-28 22:18:05'),(197,66,'Contacto',NULL,NULL,7,0,0,0,79,NULL,'2016-03-28 19:18:05','2016-03-28 22:18:05'),(198,66,'Nombre Completo',NULL,NULL,1,0,0,0,80,NULL,'2016-03-28 19:18:05','2016-03-28 22:18:05'),(199,66,'Cargo',NULL,NULL,1,0,0,0,81,NULL,'2016-03-28 19:18:05','2016-03-28 22:18:05'),(200,66,'Teléfono',NULL,NULL,1,0,0,0,82,NULL,'2016-03-28 19:18:05','2016-03-28 22:18:05'),(201,66,'Email',NULL,NULL,1,0,0,0,83,NULL,'2016-03-28 19:18:05','2016-03-28 22:18:05'),(202,66,'Tamaño de la compañía',NULL,NULL,1,0,0,0,84,NULL,'2016-03-28 19:18:05','2016-03-28 22:18:05'),(203,66,'Año en que la empresa fue fundada',NULL,NULL,1,0,0,0,85,NULL,'2016-03-28 19:18:05','2016-03-28 22:18:05'),(204,66,'Network',NULL,NULL,1,0,0,0,86,NULL,'2016-03-28 19:18:05','2016-03-28 22:18:05'),(205,66,'Network (OTRA)',NULL,NULL,1,0,0,0,87,NULL,'2016-03-28 19:18:06','2016-03-28 22:18:05'),(206,66,'Holding al que pertenece la compañía',NULL,NULL,1,0,0,0,88,NULL,'2016-03-28 19:18:06','2016-03-28 22:18:06'),(207,66